import Menu from './Menu';
import Footer from './Footer';

import arrow from '../svg/arrow.svg';

// import data from '../data/data.json';



const BannerTitleContent = ({numItem, numTranslate}) => {
    return(
        <div className={`bannerTitleContent ${numItem} ${numTranslate}`}>
            <span></span>
            <p>Son</p>
        </div>
    );
}; 



const BannerTitle = ({numTranslate}) => {

    return (
        <div className={`bannerTitle`}>
            <BannerTitleContent numItem="item1" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item2" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item3" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item4" numTranslate={numTranslate}/>
            <BannerTitleContent numItem="item5" numTranslate="translate1"/>
            <BannerTitleContent numItem="item6" numTranslate="translate1"/>
            <BannerTitleContent numItem="item7" numTranslate="translate1"/>
            <BannerTitleContent numItem="item8" numTranslate="translate1"/>
            <BannerTitleContent numItem="item9" numTranslate="translate1"/>
        </div>
    );
};




const Category = () => {
    return(
        <div className='category'>
            <p>Vue.js</p>
        </div>
    ); 
}; 

const ProjectBanner = () => {
    return (
        <div className='project_banner'>
            <div className='titles_page'>
                <BannerTitle numTranslate="translate1"/>
                <BannerTitle/>
                <BannerTitle/>
            </div>
            <div className='categories_container'>
                <div className='categories'>
                    <Category/>
                    <Category/>
                    <Category/>
                    <Category/>
                </div>
                <div>
                    <a href="#fr"><img 
                    id="arrowHome" 
                    src={arrow} 
                    alt="scroll down" 
                    /></a>
                </div>

            </div>

        </div>
    ); 
}; 




const ProjectPage = () => {
    return (
        <div>
            <Menu />
            <ProjectBanner />
            <Footer />
        </div>
    );
};

export default ProjectPage;
